import React from 'react'

import Button from '@mui/material/Button'
import Fab from '@mui/material/Fab'
import { TableCell, TableRow } from '@mui/material'

type AppProps = {
    week: Date[],
    key: number
}

export default function Week({week, key}: AppProps) {
  return (
        <>
            <TableRow>
                {week.map((day: Date): any => {
                    return <TableCell align='center' key={key}>
                        {
                            <Fab size='small' sx={{borderRadius: 8}}>
                                { day.getDate() }
                            </Fab>
                            // <Button sx={{borderRadius: 2}}>
                            //     { day.getDate() }
                            // </Button>
                        }
                    </TableCell>
                })}
            </TableRow>
        </>
    )
}
